function initializeClassicColors() { //Create a grayscale array
	var classicColors = getPaletteByName("Classic");
	for (var i = 0; i < colorPalettes[1].length; i+=3) {
		var currentValue = 255-((i/colorPalettes[1].length)*255);


		classicColors[i] = currentValue;
		classicColors[i+1] = currentValue;
		classicColors[i+2] = currentValue;

	}

}

function initializeSetOnlyColors() {
	var blackWhiteColors = getPaletteByName("Set Only");
	for (var i = 0; i < colorPalettes[1].length; i+=3) {
		var currentValue = 0;
		if (i < colorPalettes[1].length-3) {
			currentValue=255;
		} 

		blackWhiteColors[i] = currentValue;
		blackWhiteColors[i+1] = currentValue;
		blackWhiteColors[i+2] = currentValue;

	}


}

function changeColors() {
	if (doClicks == true) {
		col=document.getElementById("colPicker").value;

		colors = colorPalettes[col*2+1];

		draw();
	}
}


function getPaletteByName(name) {
	
	for (var i =0; i < colorPalettes.length; i+=2) {
		if (colorPalettes[i] == name) {
			return colorPalettes[i+1];
			
		}
		
	}
	
	return colorPalettes[1];
	
}

function generateColPicker() {
	var out = "";
	
	for (var i =0; i < colorPalettes.length; i+=2) {
		out+= "<option value=\""+(i/2)+"\">"+colorPalettes[i]+"</option>";
		
	}
	document.getElementById("colPicker").innerHTML=out;

	
}

